<!doctype html>
<html>
  <head>
    <title>Login</title>
    <style>
      body {
        font-family: "Segoe UI", Tahoma, Geneva, Verdana, sans-serif;
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
        margin: 0;
        background-color: #1a1a1a;
      }

      .login-container {
        background-color: #2b2b2b;
        padding: 40px;
        border-radius: 10px;
        box-shadow: 0 2px 5px rgba(0, 0, 0, 0.3);
        text-align: center;
      }

      .login-container h1 {
        color: #ff00cc;
        margin-bottom: 30px;
      }

      .form-group {
        margin-bottom: 20px;
        text-align: left;
      }

      .form-group label {
        display: block;
        color: #e0e0e0;
        margin-bottom: 5px;
      }

      .form-group input {
        width: 100%;
        padding: 10px;
        background-color: #333333;
        color: #e0e0e0;
        border: none;
        border-radius: 5px;
      }

      button[type="submit"] {
        background: linear-gradient(45deg, #ff00cc, #333399);
        color: #fff;
        border: none;
        padding: 10px 20px;
        border-radius: 5px;
        cursor: pointer;
        transition: all 0.3s ease;
      }

      button[type="submit"]:hover {
        transform: scale(1.05);
      }
    </style>
  </head>
  <body>
    <div class="login-container">
      <h1>Login</h1>
      <form>
        <div class="form-group">
          <label for="password">Password</label>
          <input type="password" id="password" name="password" required />
        </div>
        <button type="submit" id="loginBtn">Login</button>
      </form>
    </div>
